angular.module('evid').run(['$templateCache', function($templateCache) {
  'use strict';

  $templateCache.put('app/partials/api.html',
    "<md-toolbar class=\"md-toolbar-tools md-accent\"><h2>{{ api.path }}</h2><span flex></span> <span ng-if=api.version>Version {{ api.version }}</span></md-toolbar><md-tabs md-dynamic-height><md-tab ng-repeat=\"(methodName, method) in methods\" label=\"{{ methodName }}\"><md-content ng-bind-html=method flex></md-content></md-tab></md-tabs>"
  );


  $templateCache.put('app/partials/page.html',
    "<md-toolbar class=\"md-toolbar-tools md-accent\"><h2>{{ title }}</h2></md-toolbar><md-content ng-bind-html=body flex layout-fill layout-padding></md-content>"
  );

}]);
